import React, { useState } from 'react'

function PostData1() {
    const [formdata,setFormdata]=useState({})
    const [data,setData]=useState({})
    const handleChange=(event)=>{
        setFormdata({[event.target.name]:[event.target.value]})
        
    }
    const eventHandler=()=>{
        fetch('https://localhost:4000/todo',{
            method:'POST',
            body:JSON.stringify(formdata),
        })
        .then((response)=>{
            response.json()})
            .then((result)=>{
                console.log(result)
                setFormdata('')
            })
            .catch((error)=>{
                console.log(error)
            })
    }

    return (
      <div>
          <form>
              <div>
              <input name="name" value={formdata.name ||''} onChange={handleChange}  ></input>
              </div>
              <div>
              <input name="email" value={data.email ||''} onChange={handleChange}  ></input>
              </div>
              <button onClick={eventHandler} >clickIt</button>
          </form>

      </div>
    );
  }
  
  export default PostData1;
